def productExceptSelf(nums):
    res = []
    for i in range(0,len(nums)):
        l = nums[:i]
        r = nums[i+1:]
        a = 1
        b = 1
        for x in l:
            a = a * x
        for y in r:
            b = b * y
        p = int(a*b)
        res.append(p)
    return res

